import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Login from '../pages/Login';

class AppContainer extends Component {
    constructor(props) {
      super(props);}
      render(){
          return(
              <Route 
              path="/login"
              component={() =>{
                  return(
                      <Login/>
                  )
              }}
              />
          );
    }
}

export default AppContainer;
